INSERT INTO "ozpcenter_listing" VALUES(1,'Acoustic Guitar','2018-05-01 19:27:36.502232','2018-05-01 19:27:54.424757','A guitar that produces sound acoustically by transmitting the vibration of the strings to the air as opposed to relying on electronic amplification. The sound waves from the strings of an acoustic guitar resonate through the guitar''s body, creating sound.','https://en.wikipedia.org/wiki/Acoustic_guitar','10.0','acoustic_guitar','Introduction of Steel strings and increased the area of the guitar top','A guitar that produces sound acoustically by transmitting the vibration of the strings.','Knowledge of acoustic properties of guitar','APPROVED',1,0,3.0,4,1,0,2,0,1,4,0,'UNCLASSIFIED',0,2,13,NULL,14,12,742,3,11,0,1,'None',0,NULL,0,NULL);
