INSERT INTO "ozpcenter_listing" VALUES(24,'Brisket','2018-05-01 19:27:38.141044','2018-05-01 19:27:38.141053','Brisket can be cooked many ways, including baking, boiling and roasting. Basting of the meat is often done during the cooking process. This normally tough cut of meat, due to the collagen fibers that make up the significant connective tissue in the cut, is tenderized when the collagen gelatinizes, resulting in more tender brisket. The fat cap, which is often left attached to the brisket, helps to keep the meat from drying during the prolonged cooking necessary to break down the connective tissue in the meat. Water is necessary for the conversion of collagen to gelatin, which is the hydrolysis product of collagen.
INSERT INTO "ozpcenter_listing" VALUES(25,'Building','2018-05-01 19:27:38.186055','2018-05-01 19:27:55.247164','A building or edifice is a structure with a roof and walls standing more or less permanently in one place, such as a house or factory.','http://localhost.com','1','building',NULL,'Buildings come in a  variety of sizes, shape, and functions.','None','APPROVED',1,0,3.0,2,0,1,0,1,0,2,1,'UNCLASSIFIED',0,7,109,NULL,110,108,777,4,107,0,0,'None',0,NULL,0,NULL);
