INSERT INTO "ozpcenter_listing" VALUES(27,'Business Management System','2018-05-01 19:27:38.508590','2018-05-01 19:27:55.316995','Management (or managing) is the administration of an organization, whether it be a business, a not-for-profit organization, or government body. Management includes the activities of setting the strategy of an organization and coordinating the efforts of its employees or volunteers to accomplish its objectives through the application of available resources, such as financial, natural, technological, and human resources. The term "management" may also refer to the people who manage an organization.
