INSERT INTO "ozpcenter_listing" VALUES(29,'Chain boat navigation','2018-05-01 19:27:38.672003','2018-05-01 19:27:38.672012','Chain-boat navigation or chain-ship navigation is a little-known chapter in the history of shipping on European rivers. From around the middle of the 19th century, vessels called chain boats were used to haul strings of barges upstream by using a fixed chain lying on the bed of a river. The chain was raised from the riverbed to pass over the deck of the steamer, being hauled by a heavy winch powered by a steam engine. A variety of companies operated chain boat services on rivers such as the Elbe, Rhine, Neckar, Main, Saale, Havel, Spree and Saône as well as other rivers in Belgium and the Netherlands. Chain boats were also used in the United States.
