INSERT INTO "ozpcenter_listing" VALUES(31,'Chasing Amy','2018-05-01 19:27:38.769430','2018-05-01 19:27:55.388090','Chasing Amy is a 1997 American romantic comedy-drama film written and directed by Kevin Smith. The film is about a male comic artist who falls in love with a lesbian woman, to the displeasure of his best friend. It is the third film in Smith''s View Askewniverse series.
