INSERT INTO "ozpcenter_listing" VALUES(67,'Hawaii','2018-05-01 19:27:41.870094','2018-05-01 19:27:55.973969','Hawaii is the only U.S. state located in Oceania and the only one composed entirely of islands. It is the northernmost island group in Polynesia, occupying most of an archipelago in the central Pacific Ocean. Hawaii is the only U.S. state located outside North America.','http://localhost.com','1','hawaii',NULL,'Hawaii is the 50th and most recent state to have joined the United States of America.','None','APPROVED',1,0,4.0,3,1,1,1,0,0,3,1,'UNCLASSIFIED',0,2,277,NULL,278,276,808,3,275,0,0,'None',0,NULL,0,NULL);
