INSERT INTO "ozpcenter_listing" VALUES(129,'Pokemon Ruby and Sapphire','2018-05-01 19:27:47.167591','2018-05-01 19:27:47.167600','Pokemon Ruby Version and Sapphire Version (ポケットモンスタールビー・サファイア Poketto Monsutā Rubī & Safaia, "Pocket Monsters: Ruby & Sapphire") are the third installments of the Pokemon series of role-playing video games, developed by Game Freak and published by Nintendo for the Game Boy Advance. The games were first released in Japan in late 2002 and internationally in 2003. Pokemon Emerald, a special edition version, was released two years later in each region. These three games (Pokemon Ruby, Sapphire, and Emerald) are part of the third generation of the Pokemon video game series, also known as the "advanced generation". Remakes of the two games, titled Omega Ruby and Alpha Sapphire, were released for the Nintendo 3DS worldwide on November 21, 2014, exactly twelve years to the date of the original Ruby and Sapphire release date, with the exception of Europe, where it was released on November 28, 2014.
