Grilling is done over direct, dry heat, usually over a hot fire over 500 °F (260 °C) for a few minutes. Grilling may be done over wood, charcoal, gas, or electricity. The time difference between barbecuing and grilling is because of the temperature difference; at low temperatures used for barbecuing, meat takes several hours to reach the desired internal temperature.
Smoking
Main article: Smoking (cooking)
Chicken, pork and bacon-wrapped corn cooked in a barbecue smoker

Smoking is the process of flavoring, cooking, and/or preserving food by exposing it to smoke from burning or smoldering material, most often wood. Meat and fish are the most common smoked foods, though cheeses, vegetables, nuts, and ingredients used to make beverages such as beer or smoked beer are also smoked.[full citation needed]
Roasting
See also: Pit barbecue

The masonry oven is similar to a smoke pit; it allows for an open flame but cooks more quickly and uses convection to cook. Barbecue-baking can also be done in traditional stove-ovens. It can be used to cook meats, breads and other starches, casseroles, and desserts. It uses direct and indirect heat to surround the food with hot air to cook, and can be basted in much the same manner as grilled foods.
Braising

It is possible to braise meats and vegetables in a pot on top of a grill. A gas or electric charbroil grill are the best choices for barbecue-braising, combining dry heat charbroil-grilling directly on a ribbed surface and braising in a broth-filled pot for moist heat. The pot is placed on top of the grill, covered, and allowed to simmer for a few hours. There are two advantages to barbecue-braising; it allows browning of the meat directly on the grill before the braising. It also allows for glazing of meat with sauce and finishing it directly over the fire after the braising. This effectively cooks the meat three times, which results in a soft, textured product that falls off the bone. The time needed for braising varies depending on whether a slow cooker or pressure cooker is used; it is generally slower than regular grilling or baking, but quicker than pit-smoking.[citation needed]','https://en.wikipedia.org/wiki/Barbecue','1','barbecue','Barbecue remains one of the most traditional foods in the United States.','Barbecuing is done slowly over low, indirect heat and the food is flavored by the smoking process.','Smoking
