The BeiDoü Navigation Satellite System (BDS, simplified Chinese: 北斗卫星导航系统; traditional Chinese: 北斗衛星導航系統; pinyin: Běidǒu wèixīng dǎoháng xìtǒng) is a Chinese satellite navigation system. It consists of two separate satellite constellations - a limited test system that has been operating since 2000, and a full-scale global navigation system that is currently under construction.

The first BeiDou system, officially called the BeiDou Satellite Navigation Experimental System (simplified Chinese: 北斗卫星导航试验系统; traditional Chinese: 北斗衛星導航試驗系統; pinyin: Běidǒu wèixīng dǎoháng shìyàn xìtǒng) and also known as BeiDou-1, consists of three satellites and offers limited coverage and applications. It has been offering navigation services, mainly for customers in China and neighboring regions, since 2000.

The second generation of the system, officially called the BeiDou Navigation Satellite System (BDS) and also known as COMPASS or BeiDou-2, will be a global satellite navigation system consisting of 35 satellites, and is under construction as of January 2015. It became operational in China in December 2011, with 10 satellites in use, and began offering services to customers in the Asia-Pacific region in December 2012. It is planned to begin serving global customers upon its completion in 2020.

In-mid 2015, China started the build-up of the third generation BeiDou system (BDS-3) in the global coverage constellation. The first BDS-3 satellite was launched 30 September 2015. As of March 2016, four BDS-3 in-orbit validation satellites have been launched.

According to China Daily, fifteen years after the satellite system was launched, it is now generating a turnover of $31.5 billion per annum for major companies such as China Aerospace Science and Industry Corp, AutoNavi Holdings Ltd, and China North Industries Group Corp.

Beidou has been described as a potential navigation satellite system to overtake GPS in global usage, and is expected to be more accurate than the GPS once it is fully completed.','https://en.wikipedia.org/wiki/BeiDou_Navigation_Satellite_System','1.0','beidou_navigation_satellite_system',NULL,'The BeiDoü Navigation Satellite System is a Chinese satellite navigation system','None','APPROVED',1,0,3.5,2,0,1,1,0,0,2,1,'UNCLASSIFIED',0,4,77,NULL,78,76,768,4,75,0,0,'None',0,NULL,0,NULL);
