There is currently no de facto standard for IPS, however magnetic positioning appears to be the most complete and cost effective[citation needed]. It offers accuracy without any hardware usage_requirements and a relatively low total cost of ownership[citation needed]. According to Opus Research magnetic positioning will emerge as a “foundational” indoor location technology.

Magnetic positioning was invented by Professor Janne Haverinen and Anssi Kemppainen. Noticing that buildings'' magnetic distortions were leading machines astray, they eventually turned the problem around and focused attention on the magnetic interferences caused by steel structures. What they found was that the disturbances inside them were consistent, creating a magnetic fingerprint unique to a building.

Professor Janne Haverinen founded the company IndoorAtlas in 2012 to commercialize the magnetic positioning solution with dual headquarters in Mountain View, CA and Oulu, Finland.','https://en.wikipedia.org/wiki/Magnetic_positioning','1.0','magnetic_positioning',NULL,'Magnetic positioning is an IPS (Indoor positioning system) solution based on magnetic sensor data','None','APPROVED',1,0,3.0,2,1,0,0,0,1,2,1,'UNCLASSIFIED',0,4,405,NULL,406,404,838,4,403,0,0,'None',0,NULL,0,NULL);
