Many maps are static, fixed to paper or some other durable medium, while others are dynamic or interactive. Although most commonly used to depict geography, maps may represent any space, real or imagined, without regard to context or scale, such as in brain mapping, DNA mapping, or computer network topology mapping. The space being mapped may be two dimensional, such as the surface of the earth, three dimensional, such as the interior of the earth, or even more abstract spaces of any dimension, such as arise in modeling phenomena having many independent variables.
Although the earliest maps known are of the heavens, geographic maps of territory have a very long tradition and exist from ancient times. The word "map" comes from the medieval Latin Mappa mundi, wherein mappa meant napkin or cloth and mundi the world. Thus, "map" became the shortened term referring to a two-dimensional representation of the surface of the world.','https://en.wikipedia.org/wiki/Map','1.0','map_of_the_world',NULL,'A map is a symbolic depiction emphasizing relationships between elements of some space and objects.','None','APPROVED',1,0,5.0,2,2,0,0,0,0,2,1,'UNCLASSIFIED',0,4,417,NULL,418,416,843,5,415,0,0,'None',0,NULL,0,NULL);

