Mixing consoles are used in many applications, including recording studios, public address systems, sound reinforcement systems, nightclubs, dance clubs, broadcasting, television, and film post-production. A typical, simple application combines signals from two microphones (each used by vocalists singing a duet, perhaps) into an amplifier that drives one set of speakers simultaneously. In live performances, the signal from the mixer usually goes directly to an amplifier which is plugged into speaker cabinets, unless the mixer has a built-in power amplifier or is connected to powered speakers. A DJ mixer may have only two channels, for mixing two record players. A coffeehouse''s tiny stage might only have a six channel mixer, enough for two singer-guitarists and a percussionist. A nightclub stage''s mixer for rock music shows may have 24 channels for mixing the signals from a rhythm section, lead guitar and several vocalists. A mixing console for a large concert may have 48 channels. A mixing console in a professional recording studio may have as many as 96 channels.','https://en.wikipedia.org/wiki/Mixing_console','1','mixing_console',NULL,'a mixing console is an electronic device for combining, routing, and changing the volume level','Music','APPROVED',1,0,1.0,1,0,0,0,0,1,1,1,'UNCLASSIFIED',0,3,437,NULL,438,436,856,2,435,0,0,'None',0,NULL,0,NULL);
