Navigation is a field of study that focuses on the process of monitoring and controlling the movement of a craft or vehicle from one place to another. The field of navigation includes four general categories: land navigation, marine navigation, aeronautic navigation, and space navigation.
It is also the term of art used for the specialized knowledge used by navigators to perform navigation tasks. All navigational techniques involve locating the navigator''s position compared to known locations or patterns.
Navigation, in a broader sense, can refer to any skill or study that involves the determination of position and direction. In this sense, navigation includes orienteering and pedestrian navigation. For information about different navigation strategies that people use, visit human navigation.','https://en.wikipedia.org/wiki/Navigation','1.0','navigation',NULL,'Navigation is a field of study that focuses on the movement of a craft or vehicle','None','APPROVED',1,0,4.2,5,3,1,0,1,0,5,1,'UNCLASSIFIED',0,4,473,NULL,474,472,868,3,471,0,0,'None',0,NULL,0,NULL);
Google Maps is a web mapping service developed by Google. It offers satellite imagery, street maps, 360° panoramic views of streets (Street View), real-time traffic conditions (Google Traffic), and route planning for traveling by foot, car, bicycle (in beta), or public transportation.

Google Maps began as a C++ desktop program designed by Lars and Jens Eilstrup Rasmussen at Where 2 Technologies. In October 2004, the company was acquired by Google, which converted it into a web application. After additional acquisitions of a geospatial data visualization company and a realtime traffic analyzer, Google Maps was launched in February 2005. The service''s front end utilizes JavaScript, XML, and Ajax. Google Maps offers an API that allows maps to be embedded on third-party websites, and offers a locator for urban businesses and other organizations in numerous countries around the world. Google Map Maker allowed users to collaboratively expand and update the service''s mapping worldwide but was discontinued from March, 2017. However crowdsourced contributions to Google Maps are not ending as the company announced those features will be transferred to Google''s Local Guides programme.

Google Maps'' satellite view is a "top-down" or "birds eye" view; most of the high-resolution imagery of cities is aerial photography taken from aircraft flying at 800 to 1,500 feet (240 to 460 m), while most other imagery is from satellites. Much of the available satellite imagery is no more than three years old and is updated on a regular basis. Google Maps uses a close variant of the Mercator projection, and therefore cannot accurately show areas around the poles.

The current redesigned version of the desktop application was made available in 2013, alongside the "classic" (pre-2013) version. Google Maps for mobile was released in September 2008 and features GPS turn-by-turn navigation. In August 2013, it was determined to be the world''s most popular app for smartphones, with over 54% of global smartphone owners using it at least once.

In 2012, Google reported having over 7,100 employees and contractors directly working in mapping.','https://en.wikipedia.org/wiki/Google_Maps#External_links','1.0','navigation_using_maps',NULL,'Description of Google Maps is a web mapping service developed by Google','None','APPROVED',1,0,3.5,2,0,1,1,0,0,2,1,'UNCLASSIFIED',0,4,477,NULL,478,476,870,2,475,0,0,'None',0,NULL,0,NULL);

Neptune is not visible to the unaided eye and is the only planet in the Solar System found by mathematical prediction rather than by empirical observation. Unexpected changes in the orbit of Uranus led Alexis Bouvard to deduce that its orbit was subject to gravitational perturbation by an unknown planet. Neptune was subsequently observed with a telescope on 23 September 1846 by Johann Galle within a degree of the position predicted by Urbain Le Verrier. Its largest moon, Triton, was discovered shortly thereafter, though none of the planet''s remaining known 14 moons were located telescopically until the 20th century. The planet''s distance from Earth gives it a very small apparent size, making it challenging to study with Earth-based telescopes. Neptune was visited by Voyager 2, when it flew by the planet on 25 August 1989. The advent of the Hubble Space Telescope and large ground-based telescopes with adaptive optics has recently allowed for additional detailed observations from afar.

Like Jupiter and Saturn, Neptune''s atmosphere is composed primarily of hydrogen and helium, along with traces of hydrocarbons and possibly nitrogen, but it contains a higher proportion of "ices" such as water, ammonia, and methane. However, its interior, like that of Uranus, is primarily composed of ices and rock, which is why Uranus and Neptune are normally considered "ice giants" to emphasise this distinction. Traces of methane in the outermost regions in part account for the planet''s blue appearance.

In contrast to the hazy, relatively featureless atmosphere of Uranus, Neptune''s atmosphere has active and visible weather patterns. For example, at the time of the Voyager 2 flyby in 1989, the planet''s southern hemisphere had a Great Dark Spot comparable to the Great Red Spot on Jupiter. These weather patterns are driven by the strongest sustained winds of any planet in the Solar System, with recorded wind speeds as high as 2,100 kilometres per hour (580 m/s; 1,300 mph). Because of its great distance from the Sun, Neptune''s outer atmosphere is one of the coldest places in the Solar System, with temperatures at its cloud tops approaching 55 K (−218 °C). Temperatures at the planet''s centre are approximately 5,400 K (5,100 °C). Neptune has a faint and fragmented ring system (labelled "arcs"), which was discovered in 1982, then later confirmed by Voyager 2.','https://en.wikipedia.org/wiki/Neptune','1.0','neptune',NULL,'Neptune is the eighth and farthest known planet from the Sun in the Solar System.','Requires the internet.','APPROVED',1,0,3.0,2,1,0,0,0,1,2,1,'UNCLASSIFIED',0,3,481,NULL,482,480,872,3,479,0,0,'None',0,NULL,0,NULL);
