For satellite navigation in automobile navigation systems, see Automotive navigation system.
A satellite navigation or satnav system is a system that uses satellites to provide autonomous geo-spatial positioning. It allows small electronic receivers to determine their location (longitude, latitude, and altitude/elevation) to high precision (within a few metres) using time signals transmitted along a line of sight by radio from satellites. The system can be used for providing position, navigation or for tracking the position of something fitted with a receiver (satellite tracking). The signals also allow the electronic receiver to calculate the current local time to high precision, which allows time synchronisation. Satnav systems operate independently of any telephonic or internet reception, though these technologies can enhance the usefulness of the positioning information generated.

A satellite navigation system with global coverage may be termed a global navigation satellite system (GNSS). As of December 2016 only the United States NAVSTAR Global Positioning System (GPS), the Russian GLONASS and the European Union''s Galileo are global operational GNSSs. The European Union''s Galileo GNSS is scheduled to be fully operational by 2020. China is in the process of expanding its regional BeiDou Navigation Satellite System into the global BeiDou-2 GNSS by 2020. France, India and Japan are in the process of developing regional navigation and augmentation systems as well.

Global coverage for each system is generally achieved by a satellite constellation of 18-30 medium Earth orbit (MEO) satellites spread between several orbital planes. The actual systems vary, but use orbital inclinations of >50° and orbital periods of roughly twelve hours (at an altitude of about 20,000 kilometres or 12,000 miles).','https://en.wikipedia.org/wiki/Satellite_navigation','1.0','satellite_navigation',NULL,'A satellite navigation or satnav system is a system that uses satellites to provide geo positioning','None','APPROVED',1,0,4.0,2,1,0,1,0,0,2,1,'UNCLASSIFIED',0,4,593,NULL,594,592,887,4,591,0,0,'None',0,NULL,0,NULL);

Saturn''s interior is probably composed of a core of iron-nickel and rock (silicon and oxygen compounds). This core is surrounded by a deep layer of metallic hydrogen, an intermediate layer of liquid hydrogen and liquid helium, and finally outside the Frenkel line a gaseous outer layer. Saturn has a pale yellow hue due to ammonia crystals in its upper atmosphere. Electrical current within the metallic hydrogen layer is thought to give rise to Saturn''s planetary magnetic field, which is weaker than Earth''s, but has a magnetic moment 580 times that of Earth due to Saturn''s larger size. Saturn''s magnetic field strength is around one-twentieth of Jupiter''s. The outer atmosphere is generally bland and lacking in contrast, although long-lived features can appear. Wind speeds on Saturn can reach 1,800 km/h (500 m/s), higher than on Jupiter, but not as high as those on Neptune.

Saturn has a prominent ring system that consists of nine continuous main rings and three discontinuous arcs and that is composed mostly of ice particles with a smaller amount of rocky debris and dust. 62 moons are known to orbit Saturn, of which fifty-three are officially named. This does not include the hundreds of moonlets comprising the rings. Titan, Saturn''s largest moon, and the second-largest in the Solar System, is larger than the planet Mercury, although less massive, and is the only moon in the Solar System to have a substantial atmosphere.','https://en.wikipedia.org/wiki/Saturn','1.0','saturn',NULL,'Saturn is the sixth planet from the Sun and the second-largest in the Solar System','Requires the internet.','APPROVED',1,0,4.0,2,1,0,1,0,0,2,1,'UNCLASSIFIED',0,3,597,NULL,598,596,889,3,595,0,0,'None',0,NULL,0,NULL);
